            function loadMoreAirports() {
                const airportList = document.getElementById("airportList");
                const fragment = document.createDocumentFragment();

                // Load the next batch of airports
                for (let i = currentIndex; i < Math.min(currentIndex + airportsPerPage, allAirports.length); i++) {
                    const airport = allAirports[i];
                    const div = document.createElement("div");
                    div.className = "airport";
                    div.innerHTML = `
                        <strong>${airport.icao} (${airport.iata})</strong> - 
                        <a href="airports/${airport.icao}/index.html" target="_blank">View Airport</a>

                    fragment.appendChild(div);
                }

                airportList.appendChild(fragment);
                currentIndex += airportsPerPage;

                // Hide "Load More" button if all airports are loaded
                if (currentIndex >= allAirports.length) {
                    document.getElementById("loadMoreButton").style.display = "none";
                }
            }

            function filterAirports() {
                const searchInput = document.getElementById("searchInput").value.toLowerCase();
                const airports = document.querySelectorAll(".airport");
                airports.forEach(airport => {
                    const text = airport.textContent.toLowerCase();
                    if (text.includes(searchInput)) {
                        airport.classList.remove("hidden");
                    } else {
                        airport.classList.add("hidden");
                    }
                });
            }

            document.addEventListener("DOMContentLoaded", () => {
                loadMoreAirports();  // Load the first batch of airports
            });

        <div id="airportList" class="airport-list"></div>
        <div class="load-more" id="loadMoreButton">
            <button onclick="loadMoreAirports()">Load More</button>
        </div>
